import React, { Fragment, useState } from 'react';
import PropTypes from 'prop-types';
import Navbar from './components/Navbar';
import Textbox from './components/Textbox';
import axios from 'axios';

const App = () => {
  const getOutput = (code, lang) => {
    console.log('Hello');
    axios
      .post('https://api.judge0.com/submissions', {
        source_code: code,
        language_id: 15
      })
      .then(e => {
        axios.get('https://api.judge0.com/submissions/${e.token}').then(d => {
          console.log(d);
        });
      });
  };

  return (
    <div className='App'>
      <Navbar />

      <Textbox getOutput={getOutput} />
    </div>
  );
};

export default App;
